import * as React from "react";
import { Button, Container } from "@mui/material";
import GenericInputField from "./TextField";

export default function UserEntry() {
  return (
    <Container
      sx={{
        height: "50vh",
        width: "30%",
        boxShadow: 4,
        mt: 20,
        p: 3,
      }}
      //margin={"0 auto"}
    >
      <GenericInputField
        label="FirstName"
        helperText="FirstName"
        errorStatus={false}
        type="onlyAlpha"
      />
      <GenericInputField
        label="LastName"
        helperText="LastName"
        errorStatus={false}
        type="onlyAlpha"
      />
      <GenericInputField
        label="Email"
        helperText="Email"
        errorStatus={false}
        type="email"
      />
      <Button>Add Me</Button>
    </Container>
  );
}
